import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import TopBar from "./components/TopBar";
ReactDOM.render(<TopBar />, document.getElementById('bar'));
ReactDOM.render(<App />, document.getElementById('root'));

